(window.webpackJsonp=window.webpackJsonp||[]).push([[71],{654:function(n){n.exports={name:"checkbox",displayName:"CheckBox *复选框*",group:"form",text:'\n传统「CheckBox」风格的切换选择组件；\n\n``` demo.5e6c7c66\nimport { CheckBox } from \'nami\'\n\nrender(<CheckBox label="Check Box" />)\n```\n\n## 状态\n\n通过 `state` 参数定义组件状态：\n\n``` demo.91556b39\nimport { CheckBox } from \'nami\'\n\nrender(\n    <div>\n        <CheckBox label="Success" state="success" />\n        <CheckBox label="Warning" state="warning" />\n        <CheckBox label="Danger" state="danger" />\n    </div>\n)\n```\n\n## 禁用\n\n通过 `disabled` 参数，可以禁用组件：\n\n``` demo.0a7c5154\nimport { CheckBox } from \'nami\'\n\nrender(\n    <div>\n        <CheckBox label="Check Box" disabled />\n        <CheckBox label="Check Box" disabled defaultChecked />\n    </div>\n)\n```\n\n**注意：**禁用或只读输入框没有状态样式：\n\n``` demo.9ae41066\nimport { CheckBox } from \'nami\'\n\nrender(\n    <div>\n        <CheckBox label="Success" state="success" disabled />\n        <CheckBox label="Success" state="success" disabled defaultChecked />\n    </div>\n)\n```\n\n## 参数\n\n### CheckBox\n\n| 参数             | 说明                   | 类型                                             | 默认值  |\n| ---------------- | ---------------------- | ------------------------------------------------ | ------- |\n| `name`           | 该复选框所属分组的名字 | `string`                                         |         |\n| `label`          | 标题文本               | `string`                                         |         |\n| `checked`        | 是否选中               | `boolean`                                        |         |\n| `defaultChecked` | 默认是否选中           | `boolean`                                        |         |\n| `value`          | 表单值                 | `string`                                         |         |\n| `state`          | 状态                   | `\'success\'` &#124; `\'warning\'` &#124; `\'danger\'` |         |\n| `disabled`       | 是否禁用               | `boolean`                                        | `false` |\n| `onChange`       | 选中状态改变事件       | `(e: ChangeEvent) => void`                       |         |\n',path:"./src/components/checkbox/index.md",demos:{"5e6c7c66":{name:"default"},"91556b39":{name:"state"},"0a7c5154":{name:"disabled"},"9ae41066":{name:"disabled-has-state"}}}}}]);